import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { adminAPI } from '../../api/endpoints';

const AllPatients = () => {
  const [patients, setPatients] = useState([]);
  const [filteredPatients, setFilteredPatients] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetchPatients();
  }, []);

  useEffect(() => {
    const filtered = patients.filter(patient =>
      patient.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      patient.phone.includes(searchTerm) ||
      patient.department.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setFilteredPatients(filtered);
  }, [patients, searchTerm]);

  const fetchPatients = async () => {
    try {
      const response = await adminAPI.getAllPatients();
      setPatients(response.data);
      setFilteredPatients(response.data);
    } catch (error) {
      console.error('Error fetching patients:', error);
    }
  };

  const handlePatientClick = (patientId) => {
    navigate(`/patient/${patientId}`);
  };

  return (
    <div className="all-patients" style={{margin: '20px', padding: '24px'}}>
      <h2 style={{color: '#ffa057', margin: '0 0 24px 0'}}>All Patients</h2>
      <div className="search-bar" style={{marginBottom: '24px'}}>
        <input
          type="text"
          placeholder="Search patients by name, phone, or department..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          style={{width: '100%', maxWidth: '400px', padding: '12px', borderRadius: '8px', border: '1px solid #3a3f5c', background: '#1e1e2f', color: '#ccd6f6', fontSize: '14px'}}
        />
      </div>
      <div className="patients-grid" style={{display: 'grid', gap: '16px'}}>
        {filteredPatients.map(patient => (
          <div key={patient.id} className="patient-card" onClick={() => handlePatientClick(patient.id)} style={{background: '#2a2d47', borderRadius: '12px', padding: '20px', border: '1px solid #3a3f5c', transition: 'all 0.3s ease', cursor: 'pointer'}} onMouseOver={(e) => e.currentTarget.style.transform = 'translateY(-2px)'} onMouseOut={(e) => e.currentTarget.style.transform = 'translateY(0)'}>
            <h3 style={{color: '#ccd6f6', margin: '0 0 12px 0', fontSize: '18px', fontWeight: '600', display: 'flex', alignItems: 'center', gap: '8px'}}>
              <span style={{background: '#ffa057', color: 'white', width: '32px', height: '32px', borderRadius: '50%', display: 'flex', alignItems: 'center', justifyContent: 'center', fontSize: '14px', fontWeight: '700'}}>👥</span>
              {patient.name}
            </h3>
            <div style={{display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(150px, 1fr))', gap: '8px', marginBottom: '16px'}}>
              <p style={{color: '#a0aec0', margin: '4px 0', fontSize: '14px'}}>Age: <span style={{color: '#ccd6f6'}}>{patient.age}</span></p>
              <p style={{color: '#a0aec0', margin: '4px 0', fontSize: '14px'}}>Gender: <span style={{color: '#ccd6f6'}}>{patient.gender}</span></p>
              <p style={{color: '#a0aec0', margin: '4px 0', fontSize: '14px'}}>Phone: <span style={{color: '#64ffda'}}>{patient.phone}</span></p>
              <p style={{color: '#a0aec0', margin: '4px 0', fontSize: '14px'}}>Department: <span style={{color: '#ffa057'}}>{patient.department}</span></p>
              <p style={{color: '#a0aec0', margin: '4px 0', fontSize: '14px'}}>Created: <span style={{color: '#64ffda'}}>{new Date(patient.created_at).toLocaleDateString()}</span></p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AllPatients;
